import React from "react";
import "./Home.css";
import Product from "./Product";

function Home() {
  return (
    <div className="home">
      <div className="home-container">
        <img
          src="https://images-eu.ssl-images-amazon.com/images/G/02/digital/video/merch2016/Hero/Covid19/Generic/GWBleedingHero_ENG_COVIDUPDATE__XSite_1500x600_PV_en-GB._CB428684220_.jpg"
          className="banner-image"
          alt="Banner"
        />
        <div className="row">
          <Product
            title="The Lean Startup"
            rating={5}
            price={9.99}
            image="https://images-na.ssl-images-amazon.com/images/I/91cwOSS4sDL.jpg"
          />
          <Product
            title="Harry Potter"
            rating={4}
            price={19.99}
            image="https://images-na.ssl-images-amazon.com/images/I/910ityjoncL.jpg"
          />
        </div>
        <div className="row">
          <Product
            title="Spiderman"
            rating={4}
            price={2.99}
            image="https://images-na.ssl-images-amazon.com/images/I/91VPHVqSXDL.jpg"
          />
          <Product
            title="Sidemen"
            rating={2}
            price={5.99}
            image="https://images-na.ssl-images-amazon.com/images/I/41NDWwKMlAL.jpg"
          />
          <Product
            title="Batman"
            rating={5}
            price={90.99}
            image="https://images-na.ssl-images-amazon.com/images/I/51CBx1+QdSL.jpg"
          />
        </div>
        <div className="row">
          <Product />
        </div>
      </div>
    </div>
  );
}

export default Home;
